import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Image } from 'react-bootstrap';
import NavigationBar from '../../components/NavigationBar'


import './styles.css';

function Quiz() {
  const [items, setItems] = useState([]);
  useEffect(() => {
    setItems([
      {name: 0},
      {name: 0},
      {name: 0},
      {name: 0},])
  },[]);
  return ( 
    <>
    <NavigationBar/>
    <Container > 
      {items.map((item) =>(
        <Row>
          <Col  xs={12} md={12}>
            {item.name}
          </Col>
        </Row>
        ))}       
    </Container>   

    </>
  );
}

export default Quiz;
